import React from 'react';
import { Card, Button } from 'react-bootstrap';
import "./style.css"
import skillsList from "../../utils/skills-list";


function Skills(props) {
    return (
        <Card>
        <Card.Header as="h5">{props.name}</Card.Header>
        <Card.Body>
            <Card.Title>Special title treatment</Card.Title>
            <Card.Text>

                {/* Loop through array of images, set prop in the skills page
                IF prop.name === front end, render these, if not, these etc. */}

            <img
                className="skills-images"
                src={require("../../assets/icons/cssGood.png")}
                alt="css"
            />
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
        </Card.Body>
        </Card>
    );
}

export default Skills;
